INSERT INTO `config_nivel_academico` VALUES (1,'Educación Inicial','Atención integral a niños y niñas desde maternal (0-3 años) hasta preescolar (3-6 años).'),(2,'Educación Primaria','Formación básica en áreas como matemáticas, ciencias, lenguaje, historia y geografía. Duración: 6 años (1° a 6° grado).'),(3,'Educación Media General','Formación en ciencias, humanidades y artes. Duración: 5 años (1° a 5° año).'),(4,'Educación Media Técnica','Formación técnica en áreas como informática, administración, turismo, etc. Duración: 5 años (1° a 5° año).'),(5,'Técnico Superior Universitario (TSU)','Carreras cortas de 2 a 3 años. Formación técnica especializada.'),(6,'Licenciatura','Carreras universitarias de 4 a 6 años. Formación profesional en diversas áreas.'),(7,'Especialización','Programas de postgrado de 1 a 2 años. Enfoque en áreas específicas.'),(8,'Maestría','Programas de postgrado de 2 años. Formación avanzada en investigación o práctica profesional.'),(9,'Doctorado','Programas de postgrado de 3 a 5 años. Enfoque en investigación y desarrollo académico.'),(10,'Educación Especial','Dirigida a personas con necesidades educativas especiales (discapacidades o talentos excepcionales).'),(11,'Educación de Adultos','Dirigida a personas que no completaron su educación formal en la edad regular.'),(12,'Educación Militar','Formación en instituciones militares para la defensa y seguridad de la nación.'),(13,'Educación Intercultural y Bilingüe','Dirigida a comunidades indígenas, respetando su lengua y cultura.'),(14,'Educación Rural','Dirigida a poblaciones en zonas rurales, adaptada a sus necesidades y contextos.'),(15,'Formación Profesional','Cursos y programas técnicos no universitarios para capacitar en áreas específicas.');
/*!40000 ALTER TABLE `config_nivel_academico` ENABLE KEYS */;
UNLOCK TABLES;

